import styled from "styled-components";

export const FooterContainer = styled.footer`
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #737373;
    padding: 20px;

    @media (max-width: 768px) {
        padding: 10px;
    }
`;

export const FooterText = styled.p`
    font-size: 14px;
    color: #666;
    text-align: center;

    @media (max-width: 768px) {
        font-size: 12px;
    }
`;
